// SPDX-License-Identifier: MIT
pragma solidity <0.8.0 =0.7.6 >=0.4.24 >=0.6.0 >=0.6.2 >=0.6.9 ^0.7.0;
pragma abicoder v2;

import "contracts/Initializable.sol";
import "contracts/OwnableUpgradeable.sol";
import "contracts/AssetMatcher.sol";
import "contracts/TransferExecutor.sol";
import "contracts/OrderValidator.sol";
import "contracts/library/LibDirectTransfer.sol";
import "contracts/library/LibFill.sol";
import "contracts/interface/ITransferManager.sol";

abstract contract ExchangeV2Core is
    Initializable,
    OwnableUpgradeable,
    AssetMatcher,
    TransferExecutor,
    OrderValidator,
    ITransferManager
{
    using SafeMathUpgradeable for uint256;
    using LibTransfer for address;

    uint256 private constant UINT256_MAX = type(uint256).max;

    //state of the orders
    mapping(bytes32 => uint256) public fills;
    mapping(address => mapping(bytes => mapping(uint16 => uint256)))
        private cancelledOrFiledOrders;

    //events
    event Cancel(bytes32 hash);
    event CancelOrder(address maker, bytes sig, uint16 index);
    event FillOrder(
        address maker,
        address taker,
        bytes sig,
        uint16 index,
        uint256 currentFilledValue
    );
    event Match(
        bytes32 leftHash,
        bytes32 rightHash,
        uint256 newLeftFill,
        uint256 newRightFill
    );

    function cancel(LibOrder.Order memory order) external {
        require(_msgSender() == order.maker, "not a maker");
        require(order.salt != 0, "0 salt can't be used");
        bytes32 orderKeyHash = LibOrder.hashKey(order);
        fills[orderKeyHash] = UINT256_MAX;
        emit Cancel(orderKeyHash);
    }

    function cancelOrder(LibOrder.Order memory order) external {
        require(_msgSender() == order.maker, "not a maker");
        cancelledOrFiledOrders[_msgSender()][order.sig][order.index] = order
            .makeAsset
            .value;
        emit CancelOrder(_msgSender(), order.sig, order.index);
    }

    /**
     * @dev function, generate sellOrder and buyOrder from parameters and call validateAndMatch() for purchase transaction

    */

    // function directPurchase(
    //     LibDirectTransfer.Purchase calldata direct
    // ) external payable {
    //     LibAsset.Asset memory paymentAssetType = getPaymentAssetType(
    //         direct.paymentToken
    //     );

    //     LibOrder.Order memory sellOrder = LibOrder.Order(
    //         direct.sellOrderMaker,
    //         LibAsset.Asset(
    //             LibAsset.AssetType(direct.nftAssetClass, direct.nftData),
    //             direct.sellOrderNftAmount
    //         ),
    //         address(0),
    //         LibAsset.Asset(paymentAssetType, direct.sellOrderPaymentAmount),
    //         direct.sellOrderSalt,
    //         direct.sellOrderStart,
    //         direct.sellOrderEnd,
    //         direct.sellOrderDataType,
    //         direct.sellOrderData
    //     );

    //     LibOrder.Order memory buyOrder = LibOrder.Order(
    //         address(0),
    //         LibAsset.Asset(paymentAssetType, direct.buyOrderPaymentAmount),
    //         address(0),
    //         LibAsset.Asset(
    //             LibAsset.AssetType(direct.nftAssetClass, direct.nftData),
    //             direct.buyOrderNftAmount
    //         ),
    //         0,
    //         0,
    //         0,
    //         direct.sellOrderDataType,
    //         direct.buyOrderData
    //     );

    //     validateFull(sellOrder, direct.sellOrderSignature);

    //     matchAndTransfer(sellOrder, buyOrder);
    // }
    function directAcceptBid(LibDirectTransfer.AcceptBid calldata direct)
        external
        payable
    {
        LibOrder.Order memory bidOrder = direct.bidOrder;
        LibOrder.Order memory sellOrder = direct.sellOrder;
        sellOrder.takeAsset = bidOrder.makeAsset;
        // LibAsset.AssetType calldaat paymentAssetType = getPaymentAssetType(
        //     direct.paymentToken
        // );

        // LibOrder.Order memory buyOrder = LibOrder.Order(
        //     direct.bidMaker,
        //     LibAsset.Asset(paymentAssetType, direct.bidPaymentAmount),
        //     address(0),
        //     LibAsset.Asset(
        //         LibAsset.AssetType(direct.nftAssetClass, direct.nftData),
        //         direct.bidNftAmount
        //     ),
        //     direct.bidSalt,
        //     direct.bidStart,
        //     direct.bidEnd,
        //     direct.bidDataType,
        //     direct.bidData
        // );

        // address maker;
        // LibAsset.Asset makeAsset;
        // address taker;
        // LibAsset.Asset takeAsset;
        // uint256 salt;
        // uint256 start;
        // uint256 end;
        // Fee originFee;
        // bytes data;

        //  AssetType assetType;
        // address contractAddress;
        // uint256 value;
        // uint256 id;

        require(msg.sender == sellOrder.maker, "msg sender not order maker");

        validateFull(bidOrder, bidOrder.sig);
        validateFull(sellOrder, sellOrder.sig);

        matchAndTransfer(sellOrder, bidOrder, 0);
    }

    function matchOrders(
        LibOrder.Order[] memory orderLefts,
        LibOrder.Order[] memory orderRights
    ) external payable {
        require(
            orderLefts.length == orderRights.length,
            "lefts and rights length dont match"
        );

        for (uint256 i = 0; i < orderLefts.length; i++) {
            LibOrder.Order memory orderLeft = orderLefts[i];
            LibOrder.Order memory orderRight = orderRights[i];
            uint256 currentFilledAmt = cancelledOrFiledOrders[orderLeft.maker][
                orderLeft.sig
            ][orderLeft.index];
            if (orderLeft.makeAsset.assetType == 3) {
                require(
                    cancelledOrFiledOrders[orderLeft.maker][orderLeft.sig][
                        orderLeft.index
                    ] == 0,
                    "Order has been cancelled"
                );
            }
            if (orderLeft.makeAsset.assetType == 4) {
                require(
                    verifyERC1155(
                        orderLeft.makeAsset,
                        orderRight.makeAsset,
                        currentFilledAmt
                    ),
                    "Order has been cancelled"
                );
            }
            if (orderLeft.orderType == LibOrder.OrderType.BULK) {
                bool isValidListing = validateListing(
                    orderLeft.root,
                    orderLeft.proof,
                    orderLeft
                );
                require(isValidListing, "Invalid listing");
            }
            if (orderRight.orderType == LibOrder.OrderType.BULK) {
                bool isValidListing = validateListing(
                    orderRight.root,
                    orderRight.proof,
                    orderRight
                );
                require(isValidListing, "Invalid listing");
            }
            validateOrders(orderLeft, orderRight);
            matchAndTransfer(orderLeft, orderRight, currentFilledAmt);
        }
    }

    function verifyERC1155(
        LibAsset.Asset memory leftAsset,
        LibAsset.Asset memory rightAsset,
        uint256 currentFilledAmt
    ) private pure returns (bool) {
        if (rightAsset.assetType != 4) {
            if (leftAsset.value >= currentFilledAmt + rightAsset.value) {
                return true;
            }
        }
        if (leftAsset.assetType != 4) {
            if (rightAsset.value >= currentFilledAmt + leftAsset.value) {
                return true;
            }
        }
        return false;
    }

    function validateOrders(
        LibOrder.Order memory orderLeft,
        LibOrder.Order memory orderRight
    ) internal view {
        validateFull(orderLeft, orderLeft.sig);
        validateFull(orderRight, orderRight.sig);
        if (orderLeft.taker != address(0)) {
            if (orderRight.maker != address(0))
                require(
                    orderRight.maker == orderLeft.taker,
                    "leftOrder.taker verification failed"
                );
        }
        if (orderRight.taker != address(0)) {
            if (orderLeft.maker != address(0))
                require(
                    orderRight.taker == orderLeft.maker,
                    "rightOrder.taker verification failed"
                );
        }
    }

    function matchAndTransfer(
        LibOrder.Order memory orderLeft,
        LibOrder.Order memory orderRight,
        uint256 currentFilledAmt
    ) internal {
        (
            LibAsset.Asset memory makeMatch,
            LibAsset.Asset memory takeMatch
        ) = matchAssets(orderLeft, orderRight, currentFilledAmt);

        // (
        //     LibOrderData.GenericOrderData memory leftOrderData,
        //     LibOrderData.GenericOrderData memory rightOrderData,
        //     LibFill.FillResult memory newFill
        // ) = parseOrdersSetFillEmitMatch(orderLeft, orderRight);

        if (takeMatch.assetType == 1) {
            require(msg.value >= takeMatch.value, "Invalid U2U amount");
        }

        doTransfers(
            LibDeal.DealSide({
                asset: LibAsset.Asset({
                    assetType: makeMatch.assetType,
                    contractAddress: makeMatch.contractAddress,
                    value: makeMatch.value,
                    id: makeMatch.id
                }),
                proxy: proxies[uint8(makeMatch.assetType)],
                from: orderLeft.maker,
                to: orderRight.maker
            }),
            LibDeal.DealSide({
                asset: LibAsset.Asset(
                    takeMatch.assetType,
                    takeMatch.contractAddress,
                    takeMatch.value,
                    takeMatch.id
                ),
                proxy: proxies[uint8(takeMatch.assetType)],
                from: orderRight.maker,
                to: orderLeft.maker
            })
        );
        if (takeMatch.assetType == 1 || takeMatch.assetType == 2) {
            if (takeMatch.assetType == 1) {
                require(orderLeft.makeAsset.assetType != 1);
            } else {
                require(orderLeft.makeAsset.assetType != 2);
            }
            uint256 feeAmt = (takeMatch.value * orderLeft.originFee.amount) /
                10000;
            uint256 royaltyFeeAmt = (takeMatch.value *
                orderLeft.royaltyFee.amount) / 10000;
            uint256 receivedAmt = takeMatch.value - feeAmt - royaltyFeeAmt;
            transfer(
                LibAsset.Asset({
                    assetType: takeMatch.assetType,
                    contractAddress: takeMatch.contractAddress,
                    value: receivedAmt,
                    id: takeMatch.id
                }),
                orderRight.maker,
                orderLeft.maker,
                proxies[uint8(takeMatch.assetType)]
            );
            transfer(
                LibAsset.Asset({
                    assetType: takeMatch.assetType,
                    contractAddress: takeMatch.contractAddress,
                    value: feeAmt,
                    id: takeMatch.id
                }),
                orderRight.maker,
                address(this),
                proxies[uint8(takeMatch.assetType)]
            );
            transfer(
                LibAsset.Asset({
                    assetType: takeMatch.assetType,
                    contractAddress: takeMatch.contractAddress,
                    value: royaltyFeeAmt,
                    id: takeMatch.id
                }),
                orderRight.maker,
                orderLeft.royaltyFee.receiver,
                proxies[uint8(takeMatch.assetType)]
            );
        } else {
            if (makeMatch.assetType == 1) {
                require(orderRight.makeAsset.assetType != 1);
                uint256 feeAmt = (makeMatch.value *
                    orderRight.originFee.amount) / 10000;
                uint256 royaltyFeeAmt = (makeMatch.value *
                    orderRight.royaltyFee.amount) / 10000;
                uint256 receivedAmt = makeMatch.value - feeAmt - royaltyFeeAmt;
                transfer(
                    LibAsset.Asset({
                        assetType: makeMatch.assetType,
                        contractAddress: makeMatch.contractAddress,
                        value: receivedAmt,
                        id: makeMatch.id
                    }),
                    orderLeft.maker,
                    orderRight.maker,
                    proxies[uint8(makeMatch.assetType)]
                );
                transfer(
                    LibAsset.Asset({
                        assetType: makeMatch.assetType,
                        contractAddress: makeMatch.contractAddress,
                        value: feeAmt,
                        id: makeMatch.id
                    }),
                    orderLeft.maker,
                    address(this),
                    proxies[uint8(makeMatch.assetType)]
                );
                transfer(
                    LibAsset.Asset({
                        assetType: makeMatch.assetType,
                        contractAddress: makeMatch.contractAddress,
                        value: royaltyFeeAmt,
                        id: makeMatch.id
                    }),
                    orderLeft.maker,
                    orderRight.royaltyFee.receiver,
                    proxies[uint8(makeMatch.assetType)]
                );
            }
        }
        bytes memory orderSig = orderLeft.sig;
        if (orderLeft.makeAsset.assetType == 3) {
            cancelledOrFiledOrders[orderLeft.maker][orderSig][
                orderLeft.index
            ] = 1;
        }
        if (orderLeft.makeAsset.assetType == 4) {
            cancelledOrFiledOrders[orderLeft.maker][orderSig][
                orderLeft.index
            ] += orderRight.takeAsset.value;
        }
        emit FillOrder(
            orderLeft.maker,
            orderRight.maker,
            orderLeft.sig,
            orderLeft.index,
            cancelledOrFiledOrders[orderLeft.maker][orderSig][orderLeft.index]
        );
    }

    // function parseOrdersSetFillEmitMatch(
    //     LibOrder.Order memory orderLeft,
    //     LibOrder.Order memory orderRight
    // )
    //     internal
    //     returns (
    //         LibOrderData.GenericOrderData memory leftOrderData,
    //         LibOrderData.GenericOrderData memory rightOrderData,
    //         LibFill.FillResult memory newFill
    //     )
    // {
    //     bytes32 leftOrderKeyHash = LibOrder.hashKey(orderLeft);
    //     bytes32 rightOrderKeyHash = LibOrder.hashKey(orderRight);

    //     address msgSender = _msgSender();
    //     if (orderLeft.maker == address(0)) {
    //         orderLeft.maker = msgSender;
    //     }
    //     if (orderRight.maker == address(0)) {
    //         orderRight.maker = msgSender;
    //     }

    //     leftOrderData = LibOrderData.parse(orderLeft);
    //     rightOrderData = LibOrderData.parse(orderRight);

    //     newFill = setFillEmitMatch(
    //         orderLeft,
    //         orderRight,
    //         leftOrderKeyHash,
    //         rightOrderKeyHash,
    //         leftOrderData.isMakeFill,
    //         rightOrderData.isMakeFill
    //     );
    // }

    /**
        @notice calculates fills for the matched orders and set them in "fills" mapping
        @param orderLeft left order of the match
        @param orderRight right order of the match
        @param leftMakeFill true if the left orders uses make-side fills, false otherwise
        @param rightMakeFill true if the right orders uses make-side fills, false otherwise
        @return returns change in orders' fills by the match 
    */
    function setFillEmitMatch(
        LibOrder.Order memory orderLeft,
        LibOrder.Order memory orderRight,
        bytes32 leftOrderKeyHash,
        bytes32 rightOrderKeyHash,
        bool leftMakeFill,
        bool rightMakeFill
    ) internal returns (LibFill.FillResult memory) {
        uint256 leftOrderFill = getOrderFill(orderLeft.salt, leftOrderKeyHash);
        uint256 rightOrderFill = getOrderFill(
            orderRight.salt,
            rightOrderKeyHash
        );
        LibFill.FillResult memory newFill = LibFill.fillOrder(
            orderLeft,
            orderRight,
            leftOrderFill,
            rightOrderFill,
            leftMakeFill,
            rightMakeFill
        );

        if (orderLeft.makeAsset.value != 0 || orderRight.takeAsset.value != 0) {
            require(newFill.leftValue > 0, "nothing to fill");
        }
        if (orderLeft.takeAsset.value != 0 || orderRight.makeAsset.value != 0) {
            require(newFill.rightValue > 0, "nothing to fill");
        }

        if (orderLeft.salt != 0) {
            if (leftMakeFill) {
                fills[leftOrderKeyHash] = leftOrderFill.add(newFill.leftValue);
            } else {
                fills[leftOrderKeyHash] = leftOrderFill.add(newFill.rightValue);
            }
        }

        if (orderRight.salt != 0) {
            if (rightMakeFill) {
                fills[rightOrderKeyHash] = rightOrderFill.add(
                    newFill.rightValue
                );
            } else {
                fills[rightOrderKeyHash] = rightOrderFill.add(
                    newFill.leftValue
                );
            }
        }

        emit Match(
            leftOrderKeyHash,
            rightOrderKeyHash,
            newFill.rightValue,
            newFill.leftValue
        );

        return newFill;
    }

    function getOrderFill(uint256 salt, bytes32 hash)
        internal
        view
        returns (uint256 fill)
    {
        if (salt == 0) {
            fill = 0;
        } else {
            fill = fills[hash];
        }
    }

    function matchAssets(
        LibOrder.Order memory orderLeft,
        LibOrder.Order memory orderRight,
        uint256 currentFilledAmt
    )
        internal
        view
        returns (
            LibAsset.Asset memory makeMatch,
            LibAsset.Asset memory takeMatch
        )
    {
        makeMatch = matchAssets(
            orderLeft.makeAsset,
            orderRight.takeAsset,
            currentFilledAmt
        );
        require(makeMatch.assetType != 0, "assets don't match");
        takeMatch = matchAssets(
            orderLeft.takeAsset,
            orderRight.makeAsset,
            currentFilledAmt
        );
        require(takeMatch.assetType != 0, "assets don't match");
    }

    function validateFull(LibOrder.Order memory order, bytes memory signature)
        internal
        view
    {
        LibOrder.validateOrderTime(order);

        validate(order, signature);
    }

    function getPaymentAssetType(address token)
        internal
        pure
        returns (LibAsset.PaymentAsset memory)
    {
        LibAsset.PaymentAsset memory result;
        if (token == address(0)) {
            result.assetType = 1;
        } else {
            result.assetType = 2;
            result.contractAddress = token;
        }
        return result;
    }

    uint256[49] private __gap;
}

